import React from 'react';
import logo from './logo.svg';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom"
import './App.css';
import Main from './components/Main';
import Navbar from './components/Navbar';

function App() {
  return (
    <Router>
      <Routes>
      <Route path="/nav">
        <Route path="/">
          <Main/>
        </Route>

          <Navbar/>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
